"use strict";(globalThis.webpackChunkfirst_trial=globalThis.webpackChunkfirst_trial||[]).push([[1697],{9572(n){n.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"/FAQ-1","metadata":{"permalink":"/faq/FAQ-1","source":"@site/faq/FAQ-1.mdx","title":"dpkg frontend lock \uc5d0\ub7ec","description":"\uc5d0\ub7ec \uba54\uc2dc\uc9c0","date":"2026-01-20T09:13:55.000Z","tags":[],"readingTime":1.095,"hasTruncateMarker":false,"authors":[],"frontMatter":{},"unlisted":false,"nextItem":{"title":"MIG \uae30\ubc18 \ubcd1\ub82c GPU \uc0ac\uc6a9\ud558\uae30","permalink":"/faq/FAQ-2"}},"content":"## \uc5d0\ub7ec \uba54\uc2dc\uc9c0 \\n```\\ndpkg: error: dpkg frontend lock was locked by another process with pid 9634\\nNote: removing the lock file is always wrong, and can end up damaging the\\nlocked area and the entire system. See <https://wiki.debian.org/Teams/Dpkg/FAQ>.\\n```\\n\\n## \ubc1c\uc0dd \uc6d0\uc778 \\n\\n\ub2e4\ub978 \ud504\ub85c\uadf8\ub7a8(\ud504\ub85c\uc138\uc2a4)\uc5d0\uc11c dpkg\ub97c \uc0ac\uc6a9\ud558\uace0 \uc788\uc5b4 \ubc1c\uc0dd \ud558\ub294 \uc5d0\ub7ec \uc785\ub2c8\ub2e4.\\n\ubcf4\ud1b5 \ubc31\uadf8\ub77c\uc6b4\ub4dc\uc5d0\uc11c \ud328\ud0a4\uc9c0 \uc5c5\ub370\uc774\ud2b8 \ubc0f \ubcf4\uc548 \uc5c5\ub370\uc774\ud2b8 \uc9c4\ud589 \uc2dc \ubc1c\uc0dd \ud569\ub2c8\ub2e4. \\n\\n## \ud574\uacb0 \ubc29\ubc95 \\n\\n\ubcf4\uc548 \uc5c5\ub370\uc774\ud2b8\ub294 \uc6b4\uc601\uc11c\ubc84\uc5d0\uc11c\ub294 \ud544\uc218\uc801\uc73c\ub85c \uc218\ud589 \ud558\uc5ec\uc57c \ud558\uc9c0\ub9cc, \uac1c\ubc1c \uc11c\ubc84\uc5d0\uc11c\ub294 \ud544\uc218\ub294 \uc544\ub2c8\uae30\uc5d0 \ube44\ud65c\uc131\ud654 \ud569\ub2c8\ub2e4. \\n\\n```\\n$ sudo systemctl -f stop unattended-upgrades #\ud328\uc9c0\uc9c0 \uc790\ub3d9 \uc5c5\ub370\uc774\ud2b8 \ud504\ub85c\uc81c\uc2a4 \uc885\ub8cc\ud558\uae30\\n$ sudo apt remove unattended-upgrades # \ud328\uc9c0\uc9c0 \uc790\ub3d9 \uc5c5\ub370\uc774\ud2b8\uae30\ub2a5 \uc81c\uac70 (\uc7ac\ubd80\ud305 \ud544\uc694 \ud560\uc218 \uc788\uc74c)\\n$ systemctl status unattended-upgrades # \ube44\ud65c\uc131\ud654 \ud655\uc778\\n```"},{"id":"/FAQ-2","metadata":{"permalink":"/faq/FAQ-2","source":"@site/faq/FAQ-2.md","title":"MIG \uae30\ubc18 \ubcd1\ub82c GPU \uc0ac\uc6a9\ud558\uae30","description":"- (\uae30\uc874) \ud55c \ud504\ub85c\uc138\uc2a4\uac00 cuda:LOCAL_RANK(0, 1, 2, ...) \uac19\uc740 \ub85c\uceec GPU \uc778\ud14d\uc2a4 \uc9c1\uc811 \uc0ac\uc6a9","date":"2026-01-20T09:13:55.000Z","tags":[],"readingTime":1.615,"hasTruncateMarker":false,"authors":[],"frontMatter":{},"unlisted":false,"prevItem":{"title":"dpkg frontend lock \uc5d0\ub7ec","permalink":"/faq/FAQ-1"}},"content":"- (\uae30\uc874) \ud55c \ud504\ub85c\uc138\uc2a4\uac00 cuda:LOCAL_RANK(0, 1, 2, ...) \uac19\uc740 \ub85c\uceec GPU \uc778\ud14d\uc2a4 \uc9c1\uc811 \uc0ac\uc6a9\\n- (MIG \uae30\ubc18) \uac01 \ud504\ub85c\uc138\uc2a4\uac00 \uc790\uae30 MIG 1\uac1c\ub9cc \ubcf4\ub3c4\ub85d \ub9cc\ub4e0 \ub4a4, \ud504\ub85c\uc138\uc2a4 \ub0b4\ubd80\uc5d0\uc11c\ub294 \ud56d\uc0c1 cuda:0 \ub9cc \uc0ac\uc6a9 <br/>\\n(CUDA_VISIBLE_DEVICES=\ud574\ub2f9 MIG UUID)\\n\\n\\n### **1. CUDA_VISIBLE_DEVICES \uc124\uc815**\\n- \uae30\uc874 DDP (\ubb3c\ub9ac GPU)\\n    - \uc2a4\ud06c\ub9bd\ud2b8 \ubc16 (shell) \uc5d0\uc11c \uc124\uc815 \ub610\ub294 \ubbf8\uc124\uc815 (\uc790\ub3d9 \ud560\ub2f9)\\n    - \ucf54\ub4dc \ub0b4\uc5d0\uc11c LOCAL_RANK \ub85c \ub514\ubc14\uc774\uc2a4 \uc9c0\uc815\\n\\n- MIG \uae30\ubc18\\n    - `import torch` \uc804 \uac15\uc81c \ub9e4\ud551\\n        1. LOCAL_RANK \uc77d\uae30\\n        2. CUDA_VISIBLE_DEVICES \ub97c \ud574\ub2f9 \ud504\ub85c\uc138\uc2a4\uc758 MIG UUID 1\uac1c\ub85c \uc124\uc815\\n        3. NCCL \uad00\ub828 env \uc124\uc815\\n\\n```python\\nimport os\\n\\n# nvidia-smi -L \uba85\ub839\uc5b4\ub85c \ud655\uc778\ud55c MIG UUID\\nMIG_IDS = [\\n    \\"MIG-XXXXXX...\\",\\n    \\"MIG-VVVVVV...\\"\\n]\\n\\n# 1. LOCAL_RANK \uc77d\uae30\\nlocal_rank = int(os.environment.get(\\"LOCAL_RANK\\", \\"0\\"))\\n# 2. CUDA_VISIBLE_DEVICES \ub97c \ud574\ub2f9 \ud504\ub85c\uc138\uc2a4\uc758 MIG UUID 1\uac1c\ub85c \uc124\uc815\\nos.environment[\\"CUDA_VISIBLE_DEVICES\\"] = MIG_IDS[local_rank]\\n# 3. NCCL \uad00\ub828 env \uc124\uc815\\nos.environment.setdefault(\\"NCCL_P2P_DISABLE\\", \\"1\\")\\nos.environment.setdefault(\\"NCCL_IB_DISABLE\\", \\"1\\")\\n```\\n\\n### **2. set_device/device \uc9c0\uc815**\\n- \uae30\uc874 DDP\\n```python\\nlocal_rank = int(os.environ[\\"LOCAL_RANK\\"])\\ntorch.cuda.set_device(local_rank)\\ndevice = torch.device(f\\"cuda:{local_rank}\\")\\nddp_model = DDP(model, device_ids=[local_rank])\\n```\\n<br/>\\n\\n- MIG \uae30\ubc18\\n```python\\n# \ud504\ub85c\uc138\uc2a4 \ub2f9 MIG 1\uac1c\uc529 \uc0ac\uc6a9\ud558\ub3c4\ub85d \uac15\uc81c \ub9e4\ud551\\ntorch.cuda.set_device(0)\\ndevice = torch.device(\\"cuda:0\\")\\nddp_model = DDP(model, device_ids=[0])\\n```\\n\\n### **3. \uc2e4\ud589**\\n- \uae30\uc874 DDP\\n```bash\\ntorchrun --standalone --nproc_per_node=${num_devices} xxxx.py\\n```\\n<br/>\\n\\n- MIG \uae30\ubc18\\n    - \uc2e4\ud589 \uc804 CUDA_VISIBLE_DEVICES \uc138\ud305 \ud574\uc81c (\ud558\ub098\uc758 \ud504\ub85c\uc138\uc2a4\uac00 \ud558\ub098\uc758 GPU \uc0ac\uc6a9\ud558\ub3c4\ub85d \uac15\uc81c)\\n```bash\\nunset CUDA_VISIBLE_DEVICES\\n\\ntorchrun --standalone --nproc_per_node=${num_devices} xxxx.py\\n```"}]}}')}}]);